import React, { useEffect, useState } from 'react';
import { getDashboardSummary } from '../api/dashboardApi';

const Dashboard = () => {
  const [dashboardData, setDashboardData] = useState({
    total_customers: 0,
    total_interactions: 0,
    open_tickets: 0,
    intent_distribution: {},
    recent_interactions: {},
    customers: []
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedCustomerId, setSelectedCustomerId] = useState(null);
  const [customerInteraction, setCustomerInteraction] = useState("");

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        const data = await getDashboardSummary();
        setDashboardData(data || {
          total_customers: 0,
          total_interactions: 0,
          open_tickets: 0,
          intent_distribution: {},
          recent_interactions: {},
          customers: []
        });
        setLoading(false);
      } catch (err) {
        setError('Failed to fetch dashboard data');
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  const handleSendMessage = async () => {
    if (selectedCustomerId && customerInteraction) {
      try {
        await sendMessageToCustomer(selectedCustomerId, customerInteraction);
        setCustomerInteraction("");
        alert("Message sent successfully!");
      } catch (err) {
        setError('Failed to send message to customer');
      }
    } else {
      setError("Please select a customer and enter a message");
    }
  };

  const handleCustomerSelect = (customerId) => {
    setSelectedCustomerId(customerId);
  };

  if (loading) return (
    <div className="flex items-center justify-center p-8">
      <div className="text-lg">Loading dashboard...</div>
    </div>
  );

  if (error) return (
    <div className="flex items-center justify-center p-8 text-red-600">
      <div className="text-lg">{error}</div>
    </div>
  );

  return (
    <div className="p-6 max-w-7xl mx-auto">
      <h2 className="text-2xl font-bold mb-6">Dashboard Overview</h2>
      
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-8">
        <div className="p-4 bg-white rounded-lg shadow">
          <h3 className="text-lg font-medium mb-2">Total Customers</h3>
          <p className="text-2xl font-bold">{dashboardData.total_customers}</p>
        </div>
        <div className="p-4 bg-white rounded-lg shadow">
          <h3 className="text-lg font-medium mb-2">Total Interactions</h3>
          <p className="text-2xl font-bold">{dashboardData.total_interactions}</p>
        </div>
        <div className="p-4 bg-white rounded-lg shadow">
          <h3 className="text-lg font-medium mb-2">Open Tickets</h3>
          <p className="text-2xl font-bold">{dashboardData.open_tickets}</p>
        </div>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-8">
        <div className="p-4 bg-white rounded-lg shadow">
          <h3 className="text-lg font-medium mb-4">Intent Distribution</h3>
          <ul className="space-y-2">
            {Object.entries(dashboardData.intent_distribution || {}).map(([intent, count]) => (
              <li key={intent} className="flex justify-between items-center">
                <span className="font-medium">{intent}</span>
                <span className="bg-blue-100 text-blue-800 px-2 py-1 rounded">{count}</span>
              </li>
            ))}
          </ul>
        </div>

        <div className="p-4 bg-white rounded-lg shadow">
          <h3 className="text-lg font-medium mb-4">Recent Interactions</h3>
          <ul className="space-y-2">
            {Object.entries(dashboardData.recent_interactions || {}).map(([date, count]) => (
              <li key={date} className="flex justify-between items-center">
                <span className="font-medium">{date}</span>
                <span className="bg-green-100 text-green-800 px-2 py-1 rounded">{count}</span>
              </li>
            ))}
          </ul>
        </div>
      </div>

      {selectedCustomerId && (
        <div className="p-4 bg-white rounded-lg shadow mb-8">
          <h3 className="text-lg font-medium mb-4">Send Message to Customer</h3>
          <textarea 
            value={customerInteraction} 
            onChange={(e) => setCustomerInteraction(e.target.value)} 
            placeholder="Type your message..."
            className="w-full p-2 border rounded-lg mb-4 h-32"
          />
          <button 
            onClick={handleSendMessage}
            className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
          >
            Send Message
          </button>
        </div>
      )}
    </div>
  );
};

export default Dashboard;
